import {StyleSheet} from "react-native"

export default StyleSheet.create({
      card: {
        alignSelf: "center",
        width: "70%",
        height: "15%",
        backgroundColor: '#f5f5f5',
        alignItems: 'center',
        justifyContent: "center",
        borderRadius: 5,
        marginTop: "20%",
        shadowColor: "#000",
        shadowOffset: {
          width: 0,
          height: 12,
        },
        shadowOpacity: 0.58,
        shadowRadius: 16.00,
        elevation: 24
      },
      title:{
        fontSize: 18
      },
      image:{
        width: 190,
        height: 150,
        marginTop: "10%"
      },
      scrollView: {
        width: "100%",
        height: "70%",
        marginHorizontal: 20,
        backgroundColor: "red"
      }
})
